{'pk': 17858635649243370, 'user_id': 3282957956, 'text': 'En este libro Gilles Lipovetsky aborda el asunto desde dos ángulos.  En primer lugar, la seducción erótica, desde los mecanismos de cortejo en las sociedades primitivas hasta los portales de internet para encontrar pareja o ligues. Pero hay un segundo campo más amplio; en nuestra sociedad actual, las técnicas de la seducción también se aplican en otros dominios: la economía, la política, la educación, los medios de comunicación… Entramos en lo que el autor califica de donjuanismo consumista.

📚En librerías el 21 de octubre.

