{'pk': 17859758438149244, 'user_id': 3282957956, 'text': 'Guadalupe Nettel (@guadalupenettel7) es autora de #ElHuésped (finalista del Premio Herralde 2005) y sus posteriores y muy celebradas obras #PétalosyOtrasHistoriasIncómodas, #ElCuerpoEnQueNací y #DespuésDelInvierno (Premio Herralde de Novela 2014), publicadas en Anagrama. También ha escrito #ElMatrimonioDeLosPecesRojos (Premio Internacional de Narrativa Breve Ribera del Duero). Ha sido traducida a dieciocho lenguas y sus libros han obtenido, además, diversos galardones internacionales, como el Premio Nacional de Narrativa Gilberto Owen, el Antonin Artaud y el Ana Seghers.

Su último libro, #LaHijaÚnica, publicado este septiembre en Anagrama, es una novela profunda y llena de sabiduría sobre la maternidad, sobre su negación o su asunción; sobre las dudas, incertidumbres e incluso sentimientos de culpa que la envuelven; sobre las alegrías y las angustias que la acompañan. Es también una novela sobre tres mujeres –Laura, Alina, Doris– y los vínculos –de amistad, de amor– que establecen entre ellas. Una novela sobre las formas diversas que puede tomar la familia en el mundo actual. 

