{'pk': 18078448654210543, 'user_id': 3282957956, 'text': "Tras evaluar 166 originales, el jurado ha concedido el 48.º #PremioAnagramaDeEnsayo a 'Las cosas como son y otras fantasías' de Pau Luque. Un libro inteligente y ágil, que profundiza en las complejas relaciones entre moral y ficción.

Una “brillante reflexión sobre la creación artística y su capacidad para ensanchar nuestro entendimiento de la\xa0maldad y, en consecuencia, de la bondad convoca a Nick Cave, Nabokov, Iris Murdoch, Fellini, Shakespeare o Cervantes…” (Joan Riambau,\xa0miembro del jurado).

Pau Luque (Barcelona, 1982). Es ensayista y ha colaborado en medios como\xa0@el_pais\xa0y\xa0@ctxt_es. Le interesa el cruce entre filosofía, moral y literatura. Vive en Ciudad de México y es investigador en Filosofía del Derecho en el Instituto de Investigaciones Filosóficas. ¡Enhorabuena!", 'type': 1, 'created_at': 1600166826, 'created_at_utc': 1600166826, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 3282957956, 'username': 'anagramaeditor', 'full_name': 'Editorial Anagrama', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/13277563_1755662001371289_895228890_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=rHqorif72B4AX_EZGgk&oh=a3d8bdf074f915ad0d505fb7692e43f3&oe=5FD34A6A', 'profile_pic_id': '1261453304176457186_3282957956', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2398695646092025599, 'has_translation': True, 'private_reply_status': 0}

