{'pk': 17902012348541752, 'user_id': 3282957956, 'text': 'Para aquellos lectores que quieran reflexionar sobre la crisis de identidad que predomina en nuestra época determinada por Internet. Andrew O’Hagan nos trae tres historias verdaderas: la primera sobre el fundador de WikiLeaks, #JulianAssange; la segunda sobre un ciudadano del que el autor no conoce nada más que sus datos obtenidos de un cementerio y con los que solicita un pasaporte. Y la tercera, sobre un genio de las matemáticas del que en ningún momento se sabe si dice la verdad: el creador del #Bitcoin.

#LaVidaSecreta de Andrew O’Hagan para #ViajarConLibros este verano.

