{'pk': 18149143696048794, 'user_id': 3282957956, 'text': 'Hi ha fronteres que sembla que només s’hagin d’obrir amb un conjur. No són exactament barreres, ni línies rectes, ni fan un tall net. Tampoc són fronteres imaginàries ni portes que franquegin el pas a un món paral·lel, sinó llocs, situacions i circumstàncies ben reals… Pot ser que les tinguem aquí al costat, però veure-les, entendre’n els mecanismes i finalment creuar-les pot demanar tota una vida.

#NoSocAquí d’@aballbona, obra guanyadora del 5è Premi Llibres Anagrama de Novel·la. Podeu veure la presentació del llibre al nostre IGTV.

