{'pk': 17847560489144907, 'user_id': 3282957956, 'text': "#UnaDachaEnElGolfo de Emilio Sánchez Mediavilla desmonta hasta la iconoclastia la gravedad de la religión, de las tradiciones, del propio oficio de periodista. Y lo hace construyendo un relato rebosante de inteligencia, con pasajes hilarantes que recuerdan al Nigel Barley de 'El antropólogo inocente'; una crónica vibrante, escrita con claridad, lucidez y hermosura, que aborda la geopolítica de Oriente Medio, pero también captura su vida cotidiana, hecha de vivencias personales, descubrimientos, asombros, perplejidades y aprendizajes.

