{'pk': 17878169608662296, 'user_id': 3282957956, 'text': '¿Dónde está el paraíso?, se pregunta el autor en esta su última obra, escrita poco antes de su fallecimiento; y concluye que el paraíso está aquí, en la vida. Los tres breves ensayos que componen el libro son una tentativa de descubrir y analizar la alegría de vivir y existir. Asoman en estas páginas Homero, Aristófanes, Nietzsche, Keats y Johann Sebastian Bach, entre otros, ya que Rosset utiliza un marco referencial que va de los clásicos griegos a la música.

El resultado es una concisa oda a la vida escrita por un filósofo que se dispone a encarar la muerte.

