{'pk': 17882219608610364, 'user_id': 3282957956, 'text': 'Amélie Nothomb nació en Kobe (Japón) en 1967. Proviene de una antigua familia de Bruselas, aunque pasó su infancia y adolescencia en Extremo Oriente, principalmente en China y Japón, donde su padre fue embajador; en la actualidad reside en París. Desde su primera novela, Higiene del asesino, se ha convertido en una de las autoras en lengua francesa más populares y con mayor proyección internacional. 📙 Desde ayer, miércoles, podemos disfrutar de su última obra, #LosNombresEpicenos, un cuento de hadas cruel sobre una hija que solo contó con la indiferencia de su padre; la historia de un doble rechazo y una doble venganza narrada con suculenta malevolencia. (També en català)
📘 Además reeditamos #EstuporyTemblores en la colección de Compactos.

