{'pk': 18101476012135903, 'user_id': 3282957956, 'text': "Slavoj Žižek, filósofo, sociólogo, psicoanalista lacaniano, teórico cultural y activista político. Es director internacional del Instituto Birkbeck para las Humanidades de la Universidad de Londres, investigador en el Instituto de Sociología de la Universidad de Liubliana y profesor en la European Graduate School. Es uno de los ensayistas más prestigiosos y leídos de la actualidad, autor de más de cuarenta libros de filosofía, cine, psicoanálisis, materialismo dialéctico y crítica de la ideología. En Anagrama ha publicado 'Mis chistes, mi filosofía', 'La nueva lucha de clases', 'Problemas en el paraíso', 'El coraje de la desesperanza', 'La vigencia de «El manifiesto comunista»' y el próximo día 6 de mayo 'Pandemia. La covid-19 estremece al mundo', 'Pandèmia. La covid-19 trasbalsa el món' en catalán. Disponible en cualquier plataforma de venta de ebooks 📲 ✍ Traducción al castellano por Damià Alou
✍ Traducción al catalán por Ferran Ràfols

