{'pk': 17866066849684285, 'user_id': 3282957956, 'text': '"Una sociedad culta es la que enseña a leer su ciudadanía. No se trata de seleccionar un nuevo índice de libros prohibidos, sino que desarrollar estrategias de comprensión lectora para entender qué es lo que dicen los textos literarios", Marta Sanz, doctora en Filología, escritora española y crítica literaria en diferentes medios.

El pasado 4 de marzo publicamos 'pequeñas mujeres rojas', novela con la que cierra la trilogía del detective Arturo Zarco, un prisma en el que unos textos se transparentan en otros. Memoria del cuerpo y cuerpo de la memoria en los tiempos de una ultraderecha, local y universal, que nunca se marchó. Ni esta novela ni sus hermanas son ortodoxamente negras, y, sin embargo, son más negras que el betún.

