{'pk': 18043507912238475, 'user_id': 3282957956, 'text': 'La protagonista de esta historia –la propia autora– se siente extranjera por varios motivos: es hija de padres mudos, lo cual la apartó del mundo «normal»; desciende de una familia de emigrantes que salieron de Italia rumbo a Estados Unidos y nació en Brooklyn. Después, cuando con seis años regresó a Italia con su madre, fue extranjera en su país de origen, y sigue siéndolo cuando decide marcharse a vivir a Londres.

Este es un libro sobre el pasado y el presente, sobre unos padres que vivieron un matrimonio tormentoso que acabó en divorcio, sobre una infancia complicada y una adolescencia solitaria, sobre la necesidad de descubrirse a sí misma…

