{'pk': 17917972954379501, 'user_id': 3282957956, 'text': '"Hace diez años cambié de ciudad. ¿Y a mí qué?, diréis. Pues que allí dejé todos los libros que había leído hasta entonces para entrar en una casa en la que no había ni un solo libro mío". Y, tras esa mudanza entendida a modo de borrón y cuenta nueva, Alessandro Baricco inició la construcción de una biblioteca de la que ha decidido seleccionar los cincuenta mejores textos leídos durante esa década.

Lo que ofrece este volumen no tiene pretensiones de canon: es más bien un recorrido personal, una selección de libros que llegaron a sus manos a través de la recomendación de un amigo, el impulso de releer una determinada obra o un simple paseo por una librería. Y por eso la reseña de cada uno de los textos aquí reunidos viene precedida por un breve comentario sobre cómo llegó a él.

