{'pk': 17884642630497890, 'user_id': 3282957956, 'text': 'Lo que encontraremos en estas páginas es un gozoso cajón de sastre en el que hay desde clásicos –Dickens, Ambrose Bierce, Stefan Zweig, Faulkner, Rebecca West, Lampedusa, Kawabata, Curzio Malaparte, Truman Capote o Richard Brautigan– hasta contemporáneos –McEwan, Coetzee, Bolaño, Cercas, Dave Eggers, Bill Bryson, Elisabeth Strout o  el guionista William Goldman–, pasando por historiadores –Donald Kagan, Mary Beard–, autores policiacos –Fred Vargas, Elmore Leonard–, ensayistas –Isaiah Berlin, Pierre Hadot, Marc Fumaroli–, maestros antiguos –Heródoto, Descartes–, un libro sobre Glenn Gould, otros sobre tenis y fútbol…

Una lista ecléctica y heterodoxa confeccionada por un Alessandro Baricco convertido en prescriptor, que aporta siempre comentarios sagaces, un estilo ágil y desprejuiciado, una voraz pasión lectora y el convencimiento de que los libros nos ayudan a entender el mundo. @bariccoale

