{'pk': 17864028943538504, 'user_id': 3282957956, 'text': '#LosErrantes de Olga Tokarczuk, ganadora del Nobel de Literatura, es una novela inquieta e inquietante que indaga en las posibilidades del género para hablar sobre el cuerpo, el mundo y las estrategias siempre insuficientes con que intentamos cartografiarlos.
Un despliegue de inventiva cuya nómada libertad formal oculta una calculadísima coherencia temática.

