{'pk': 17886504466404370, 'user_id': 3282957956, 'text': 'Iniciem el curs de #LlibresAnagrama amb la publicació en dos volums de l’obra (quasi) completa de #JaumeSisa,\xa0el cantautor galàctic autor del clàssic "Qualsevol nit pot sortir el sol". #ElsLlibresGalàctics 1966-2018\xa0inclou el seu cançoner, una #antologia de #poemes i una selecció d’aforismes i textos dispersos d’ell i dels seus alter egos: Ventura Mestres, Ricardo Solfa, Armando Llamado i El Viajante.

Un “tot Sisa” que permet submergir-se en les vides conquistades per l’artista: la vida cantada, la somiada, la pensada, la viscuda, la prestada, l’amagada i la reencarnada.

