{'pk': 17852378683305919, 'user_id': 3282957956, 'text': '¡Hoy llega a librerías #LecturaFácil de Cristina Morales, #PremioHerraldeDeNovela!

Radical, combativa, política y en femenino. Una novela que celebra el cuerpo y la sexualidad, el deseo de y entre las mujeres, la dignidad de quien es señalada con el estigma de la discapacidad y la capacidad transgresora y revolucionaria del lenguaje. Este libro es un campo de batalla: contra el heteropatriarcado monógamo y blanco, contra la retórica institucional y capitalista, contra el activismo que usa los ropajes de «lo alternativo» para apuntalar el statu quo.

