{'pk': 17904125635180315, 'user_id': 3282957956, 'text': 'Entre l’elegia, la crònica i el thriller, Llucia Ramis ha escrit una novel·la de múltiples capes que es descabdellen amb lleugeresa i profunditat alhora. Una indagació personalíssima i valenta en el passat d’una família i d’un país; en la naturalesa de les relacions amoroses i els desenganys, de les ambicions i les frustracions; en com construïm la pròpia identitat i ens aferrem a objectes i afectes, conscients que no hi ha res que duri per sempre.

#LesPossessions de Llucia Ramis, obra guanyadora del 3 #PremiLlibresAnagrama

