{'pk': 17901991009015175, 'user_id': 3282957956, 'text': "Jorge Herralde y Lali Gubern, en la\xa0@frankfurtbookfair , celebrando el Premio Nobel de Literatura a Kazuo Ishiguro, a quien Anagrama comenzó a publicar desde 1988 con su primera novela 'Pálida luz en las colinas'. En palabras del editor:\xa0“Qué inesperada y enorme alegría! El premio a un escritor tan singular, tan apartado de los circuitos literarios de modas y tendencias, que había tardado siete años en publicar su última novela,\xa0'El gigante enterrado' ,\xa0acogida con una admiración algo estupefacta: de nuevo Ishiguro, cambiando de registro, nos había pillado a contrapié.

