{'pk': 17843701537202890, 'user_id': 3282957956, 'text': "Kazuo Ishiguro, Premio Nobel de Literatura 2017.

Su obra ha sido traducida a más de cuarenta idiomas. Es autor de siete novelas –'Páli\xadda luz en las colinas' (Premio Winifred Holtby), 'Un artista del mundo flotante' (Premio Whitbread), 'Los restos del día' (Premio Booker), 'Los inconsolables' (Premio Cheltenham), 'Cuando fuimos huérfanos', 'Nunca me abandones' (Premio Novela Europea Casi\xadno de Santiago) y 'El gigante enterrado' – y un libro de relatos 'Nocturnos', obras extraordinarias que Anagrama ha publicado en castellano.

